import React from "react";
import "./blogs.css";
const Blogs = () => {
  return (
    <>
      <div className="blog-container">
        <div className="blog-head">
          <div className="blog-head-left">
            <div className="box">
              <div className="bar"></div>
              <span>Lastest Blogs</span>
            </div>
            <h2>
              We're here to share story <br /> from latest news
            </h2>
          </div>
          <div className="blog-head-right"></div>
        </div>
      </div>
    </>
  );
};
export default Blogs;
